import React from "react";
import {
  BrowserRouter as Router,
  Route
} from "react-router-dom";import Building from "./views/building/buildingView.js";
import './App.css';


function App() {
  return (
    <Router>
      <div className="App">
          <Route exact path="/" component={Building} />
      </div>
    </Router>

  );
}

export default App;
